    "job_description": "React Native Developer\n\n100% Remote\n\nW2 Contract (Option to Hire)\n\nDo you see your next career move taking you to a Fortune 50 healthcare company? Do you aspire to work in a dynamic, high-energy, agile environment? If you feel these words describe your ideal career opportunity, we may have the position for you!\n\nThis client's Customer Experience Management team focuses on building mobile applications that simplify healthcare for its members and providers. They are needing to add a Sr. React Native to assist their team with establishing an unmatched mobile experience across all digital platforms with a focus around customer engagement, proactivity, and personalization during the customer benefit selection.\n\nThis will include working alongside the counterpart Web Development team, as well as user groups to solve business problems and maintain a strong understanding of industry standards in the digital space. You'll also be working closely with multiple Full Stack Engineering teams.\n\nThe tech stack for this group is React Native. This role will require you to have strong React Native experience, preferably previous experience migrating Android and iOS native applications to ReactNative. You will be responsible for providing guidance and thought leadership to the team. The team is a distributed onshore team that operates remotely, working Eastern Standard Time hours.\n\nRequired Qualifications\n• 5+ years of professional experience as Software Engineer or a Full-Stack Developer\n• 3+ years of demonstrable experience building software systems and solutions with React Native\n• 3+ years of experience with Node.JS or GraphQL\n• Strong analytical and reasoning skills with an ability to visualize processes and outcomes.\n• Proficiency in troubleshooting software issues and debugging complex codebase.\n• Deep understanding of agile principles and how they can be flexibly applied\n• Outstanding all-round communication skills and ability to work collaboratively\n• All-hands on deck contributor\n\nPreferred Qualification\n• A passion for solving problems and providing workable solutions\n• Experience working on cross-functional/balanced product development teams\n• Experience with human-centered design approach\n• Healthcare business experience\n• Experience working with remote distributed teams\n\nABOUT EIGHT ELEVEN:\n\nAt Eight Eleven, our business is people. Relationships are at the center of what we do. A successful partnership is only as strong as the relationship built. We’re your trusted partner for IT hiring, recruiting and staffing needs.\n\nFor over 16 years, Eight Eleven has established and maintained relationships that are designed to meet your IT staffing needs. Whether it’s contract, contract-to-hire, or permanent placement work, we customize our search based upon your company's unique initiatives, culture and technologies. With our national team of recruiters placed at 21 major hubs around the nation, Eight Eleven finds the people best-suited for your business. When you work with us, we work with you. That’s the Eight Eleven promise.\n\nEight Eleven Group provides equal employment opportunities (EEO) to all employees and applicants for employment without regard to race, color, religion, national origin, age, sex, citizenship, disability, genetic information, gender, sexual orientation, gender identity, marital status, amnesty or status as a covered veteran in accordance with applicable federal, state, and local laws.",
