    "job_description": "Our client is a rapidly growing, entrepreneurial, multi-faceted consulting company is seeking a Full Stack React developer to support a federal government entity. They are looking to add an independent, energetic, and self-motivated React developer to an established team working on a federal government project. It’s a small team of developers with support from matrixed staff in other roles. They look for someone who loves to learn and is passionate about keeping up to date with industry trends and technology.\n\nThis developer will participate in building and modernizing web-based applications to support our projects, work with technical leads to develop and enforce standards, collaborate with a development team, and follow solutions as they are developed through production deployment. The team performs custom software development to modernize siloed, legacy applications using modular design standards. The team works closely with clients and other contractors to ensure the performance and reliability of public-facing, mission-critical applications.\n\nWhat you’ll be doing:\n• Identifies requirements by establishing personal rapport with potential and actual clients and with other persons in a position to understand service requirements\n• Develops and maintains applications and databases by evaluating client needs; analyzing requirements; developing software systems\n• Bug fixing, browser testing, accessibility testing\n• Documenting code and processes\n• Collaborate with designers, developers, and project managers on client work\n• Communicating with co-workers about your projects and tasks\n• Actively participate in project discussions and team meetings (e.g., daily standups, code reviews)\n\nMinimum Qualifications:\n• BS in computer science or related field\n• 3+ years of experience building full-stack applications using JavaScript technologies\n• 3+ years of experience with React development\n• Ability to obtain and maintain a Public Trust\n\nPreferred Qualifications:\n• Experience with Node.js\n• Experience with GraphQL\n• Experience with Cloud architecture such as AWS\n• Proficient with Git and GitHub\n• Highly proficient in HTML 5, CSS 3.0, JavaScript, REST Concepts, JWT\n• Proficient understanding of cross-browser compatibility issues and ways to work around them\n\nTechnologies/tools you’ll use:\n• AWS services (S3, CloudFront, Lambda, API Gateway, RDS)\n• GitHub\n• MySQL\n• React\n• Node.js\n• GraphQL/Rest\n• JavaScript, HTML, CSS\n• Gatsby\n• Knex.js\n• Cypress",
